import './output.css';
const Navbar = () => {
  return (
    <header className="bg-gradient-to-r from-pink-300 via-blue-100 to-indigo-300 border-b-8 border-t-4 border-pink-300 shadow-md sticky top-10 z-50 h-38">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-4 flex justify-between items-center">
        <div className="
    text-5xl mb-4 text-center font-bold cursor-pointer
    transition-transform duration-700 ease-in-out
    transform hover:scale-105
  "
  style={{
    fontFamily: "'Irish Grover', system-ui",
    color: '#FF69B4', // pastel baby pink
    WebkitTextStroke: '0.2px #228B22', // soft pink border/stroke
    textShadow: `
      0 0 4px rgba(248, 204, 229, 0.8),
      0 0 10px rgba(248, 204, 229, 0.6),
      0 0 20px rgba(248, 204, 229, 0.4)
    `,
    transition: 'filter 0.7s ease-in-out, transform 0.7s ease-in-out',
  }}
  onMouseEnter={(e) => {
    e.currentTarget.style.filter = 'brightness(1.2) saturate(1.3)';
  }}
  onMouseLeave={(e) => {
    e.currentTarget.style.filter = 'brightness(1) saturate(1)';
  }}>
          SafeSpace
        </div>
        <nav className="hidden md:flex space-x-8 text-gray-700 text-sm font-medium items-center">
          <a href="#home" className="hover:text-pink-600 text-3xl" style={{fontFamily:'Tilt Neon', color: "indigo"}}>Home</a>
          <a href="#features" className="hover:text-pink-600 text-3xl" style={{fontFamily:'Tilt Neon', color: "indigo"}}>Features</a>
          <a href="#how-it-works" className="hover:text-pink-600 text-3xl" style={{fontFamily:'Tilt Neon', color: "indigo"}}>How it Works</a>
          <a href="#contact" className="hover:text-pink-600 text-3xl" style={{fontFamily:'Tilt Neon', color: "indigo"}}>Contact</a>
        </nav>
        <div className="space-x-4">
          <button
  className="
    hidden md:inline-block 
    px-6 py-2 
    text-3xl font-semibold
    bg-pink-300 text-pink-900 
    rounded-full shadow-md 
    border border-pink-400
    hover:bg-pink-400 hover:text-pink-950 
    hover:shadow-lg
    transition-all duration-300 ease-in-out
  "
  style={{ fontFamily: 'Tilt Neon' }}
>
            Login
          </button>

        </div>
      </div>
    </header>
  );
};

export default Navbar;
